import React from 'react';
import Slideshow from '../Slideshow/Slideshow';
import './Projects.css';
import { hackathon_slides } from '../path-to-your-data/hackathon_slides';

function Projects() {
  return (
    <div className="projects">
      <div className="projects__section">
        <div className="projects__slideshow-container">
          <Slideshow slides={hackathon_slides} />
        </div>
      </div>
    </div>
  );
}

export default Projects;
